export class Serch extends Component {
    state ={
        search : "salam"
    }
    render() {

        const { search }=this.state;
        return ( 

            <div>
                <form>
                    <div className="form-group">

                        <input value={search} id="search" type="text"/> <br/>
                        <button placeholder="search" className="btn btn-danger btn-bloc">Search</button>
                    </div>

                </form>
            </div>
        )
    }
}

export default Serch
